-- create the table aarr
CREATE TABLE IF NOT EXISTS public.aarr
(
    id integer NOT NULL GENERATED ALWAYS AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 2147483647 CACHE 1 ),
    fecha timestamp,
    v1 float,
    i1 float,
    pa1 float,
    v2 float,
    i2 float,
    pa2 float,
    v3 float,
    i3 float,
    pa3 float,
    pa float,
    fp float,
    frec float,
    v12 float,
    v23 float,
    v31 float,
    ea_import float,
    eq_import float,
    ea_export float,
    eq_export float,
    PRIMARY KEY (id)
);

-- create the table tickets
CREATE TABLE IF NOT EXISTS public.tickets
(
    id serial,
	fechacreacion timestamp,
 	fechamodificacion timestamp,
	id_ticket varchar,
    titulo varchar,
    descripcion varchar,
    estado varchar,
    step int,
    departmento varchar,
    PRIMARY KEY (id)
);

